import React from 'react';
import {BrowserRouter,Switch,Route} from 'react-router-dom';
import Navbar from './componenets/layout/Navbar';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Navbar></Navbar>
        <Switch>
          <Route path="/" component={Dashboard}></Route>
        </Switch>
      </div>
    </BrowserRouter>

  );
}

export default App;
